import React from 'react';
import ReactDataGrid from 'react-data-grid';

const columns = [
    { key: "item", name: "Item" },
    { key: "05.07", name: "05.07" }
];

const rows = [
    { item: "Klose", "05.07": 100 },
    { item: "scales", "05.07": 200 }
];

const Grid = () => {
    return (
        <ReactDataGrid
            columns={columns}
            rowGetter={i => rows[i]}
            rowsCount={2}
            minHeight={150}
        />
    )
}

export default Grid;
